const express = require('express');
const db = require('../bin/dbconnection');
const base = require('./baseController');
const logger = require('../bin/Logger');
const WelcomeLetterService = require('../services/WelcomeLetterService');

/**
 * Welcome Letter Controller
 * Handles routes for generating and retrieving welcome letters
 */
class WelcomeLetterController {
  /**
   * Constructor to bind methods to this context
   */
  constructor() {
    // Bind methods to ensure 'this' context is preserved
    this.checkCertificate = this.checkCertificate.bind(this);
    this.generate = this.generate.bind(this);
    this.updatePdfUrl = this.updatePdfUrl.bind(this);
    this.getByCustomerId = this.getByCustomerId.bind(this);
    this.checkCertificateExists = this.checkCertificateExists.bind(this);
  }

  /**
   * Check certificate and get/create AS number
   * @param {Request} req - Express request object
   * @param {Response} res - Express response object
   */
  async checkCertificate(req, res) {
    try {
      const { policyNumber } = req.body;

      if (!policyNumber) {
        logger.error('Missing required field: policyNumber');
        return base.send_response("Policy number is required", null, res, 400);
      }

      logger.info(`Checking certificate for policy number: ${policyNumber}`);

      // First check if certificate exists
      let asNumber;
      let isNew = false;

      // Check existing record
      const [existingRows] = await db.query('SELECT * FROM welcome_letter WHERE Certificate_Number = ?', [policyNumber]);

      if (existingRows && existingRows.length > 0) {
        // Use existing record
        asNumber = existingRows[0].Asnumber;
        logger.info(`Found existing record with AS number: ${asNumber}`);
      } else {
        // Create new record
        isNew = true;
        logger.info('No existing record found, creating new AS number');

        // Get next AS number
        const [numResults] = await db.query(
          'SELECT IFNULL(MAX(CAST(SUBSTRING(Asnumber, 3) AS SIGNED)), 0) + 1 AS nextNum FROM welcome_letter'
        );

        const nextNum = numResults[0].nextNum || 1;
        asNumber = 'AS' + String(nextNum).padStart(8, '0');

        // Insert new record
        const [insertResult] = await db.query(
          'INSERT INTO welcome_letter (Certificate_Number, Asnumber, Created_Date) VALUES (?, ?, NOW())',
          [policyNumber, asNumber]
        );

        logger.info(`Inserted new record with ID: ${insertResult.insertId}, AS number: ${asNumber}`);
      }

      // Return success with AS number
      return base.send_response(
        isNew ? "New certificate created" : "Certificate found",
        {
          asNumber: asNumber,
          certificateNumber: policyNumber,
          isNew: isNew
        },
        res
      );
    } catch (error) {
      logger.error(`Error checking certificate: ${error.message}`);
      logger.error(error.stack);
      return base.send_response("Error checking certificate: " + error.message, null, res, 500);
    }
  }

  /**
   * Debug method to check if certificates exist in the database
   * @param {string} certificateNumber - Policy certificate number
   * @returns {Promise<Object>} - Database record if found
   */
  async checkCertificateExists(certificateNumber) {
    try {
      logger.info(`Checking if certificate exists: ${certificateNumber}`);

      // Check if record exists
      const [rows] = await db.query('SELECT * FROM welcome_letter WHERE Certificate_Number = ?', [certificateNumber]);

      if (rows && rows.length > 0) {
        logger.info(`Found certificate record: ${JSON.stringify(rows[0])}`);
        return rows[0];
      } else {
        logger.warn(`No record found for certificate: ${certificateNumber}`);
        return null;
      }
    } catch (error) {
      logger.error(`Error checking certificate: ${error.message}`);
      throw error;
    }
  }

  async generate(req, res) {
    try {
      const formData = req.body;
      logger.info(`Generating welcome letter for customer: ${formData.customerName}`);

      // Validate required fields (removed assistanceNumber from required fields)
      const requiredFields = [
        'customerName',
        'customerAddress',
        'customerEmail',
        'customerDate',
        'departureDate',
        'arrivalDate',
        'travelDuration',
        'policyNumber',
        'assistanceCharges',
        'contactNo',
        'SupportEmail',
        'SupportcontactNo'
      ];

      const missingFields = requiredFields.filter(field => !formData[field]);

      if (missingFields.length > 0) {
        logger.error(`Missing required fields: ${missingFields.join(', ')}`);
        return base.send_response(`Missing required fields: ${missingFields.join(', ')}`, null, res, 400);
      }

      // First, get or create AS number for the policy
      logger.info(`Getting AS number for policy: ${formData.policyNumber}`);

      // Check existing record or create new
      const [existingRows] = await db.query('SELECT * FROM welcome_letter WHERE Certificate_Number = ?', [formData.policyNumber]);

      let asNumber;

      if (existingRows && existingRows.length > 0) {
        // Use existing record
        asNumber = existingRows[0].Asnumber;
        logger.info(`Found existing record with AS number: ${asNumber}`);
      } else {
        // Create new record with new AS number
        logger.info('No existing record found, creating new AS number');

        // Get next AS number
        const [numResults] = await db.query(
          'SELECT IFNULL(MAX(CAST(SUBSTRING(Asnumber, 3) AS SIGNED)), 0) + 1 AS nextNum FROM welcome_letter'
        );

        const nextNum = numResults[0].nextNum || 1;
        asNumber = 'AS' + String(nextNum).padStart(8, '0');

        // Insert new record
        await db.query(
          'INSERT INTO welcome_letter (Certificate_Number, Asnumber, PolicyStartDate, PolicyEndDate, fulladdress, fullname, PremiumAmount, EmailID, MobileNumber, travelDuration, Created_Date) VALUES (?, ?, ?, ?, ?, ?, ?, ?, ?, ?, NOW())',
          [formData.policyNumber, asNumber, formData.departureDate, formData.arrivalDate, formData.customerAddress,
          formData.customerName, formData.assistanceCharges, formData.customerEmail, formData.contactNo, formData.travelDuration]
        );


        logger.info(`Created new record with AS number: ${asNumber}`);
      }

      // Add AS number to form data
      formData.assistanceNumber = asNumber;

      // Generate unique customer ID if not provided
      const customerId = formData.customerId || `CUST-${Date.now()}`;

      // If logoImage is not provided in the request, use a default one
      if (!formData.logoImage) {

        formData.logoImage='data:image/jpeg;base64,';

        formData.travel_signImageBase64 = 'data:image/jpeg;base64,';  // Your base64 string
      }

      // Define file paths
      const pdfFileName = `WelcomeLetter_${customerId}.pdf`;
      const pdfPath = require('path').join(WelcomeLetterService.pdfStorePath, pdfFileName);
      const pdfUrl = `/welcome-letters/${pdfFileName}`;

      // Generate PDF using the service
      const result = await WelcomeLetterService.generateWelcomeLetterPdf(customerId, formData, pdfPath);


      if (!result) {
        throw new Error('Failed to generate welcome letter PDF');
      }

      // Update the database with PDF URL
      await this.updatePdfUrl(formData.policyNumber, pdfUrl);

      // Return success response with file path and AS number
      return base.send_response(
        "Welcome letter generated successfully",
        {
          pdfUrl: pdfUrl,
          customerId: customerId,
          customerName: formData.customerName,
          assistanceNumber: asNumber
        },
        res
      );

    } catch (error) {
      logger.error(`Error generating welcome letter: ${error.message}`);
      logger.error(error.stack);
      return base.send_response("Failed to generate welcome letter: " + error.message, null, res, 500);
    }
  }
  /**
   * Update PDF URL in the database
   * @param {string} certificateNumber - Policy certificate number
   * @param {string} pdfUrl - URL to the generated PDF
   * @returns {Promise<void>}
   */
  async updatePdfUrl(certificateNumber, pdfUrl) {
    try {
      logger.info(`Updating PDF URL for certificate: ${certificateNumber} with URL: ${pdfUrl}`);

      // Use direct query with await instead of promise
      const sql = 'UPDATE welcome_letter SET pdfurl = ?, Updated_Date = NOW() WHERE Certificate_Number = ?';

      const [result] = await db.query(sql, [pdfUrl, certificateNumber]);

      // Log the result of the update
      logger.info(`Update result: ${JSON.stringify(result)}`);

      if (result.affectedRows === 0) {
        logger.warn(`No rows updated for certificate: ${certificateNumber}. Certificate might not exist in the database.`);
      } else {
        logger.info(`Successfully updated ${result.affectedRows} row(s) for certificate: ${certificateNumber}`);
      }

      return result;
    } catch (error) {
      logger.error(`Error updating PDF URL: ${error.message}`);
      logger.error(error.stack);
      throw error;
    }
  }

  /**
   * Get a welcome letter by customer ID
   * @param {Request} req - Express request object
   * @param {Response} res - Express response object
   */
  async getByCustomerId(req, res) {
    try {
      const { customerId } = req.params;
      logger.info(`Retrieving welcome letter for customer ID: ${customerId}`);

      // Get the welcome letter PDF
      const result = await WelcomeLetterService.getWelcomeLetterByCustomerId(customerId);

      if (!result) {
        return base.send_response("Welcome letter not found", null, res, 404);
      }

      // Send the PDF as response
      res.setHeader('Content-Type', 'application/pdf');
      res.setHeader('Content-Disposition', `attachment; filename=Welcome_Letter_${customerId}.pdf`);

      // Send the file
      res.download(result.pdfPath, `Welcome_Letter_${customerId}.pdf`, (err) => {
        if (err) {
          logger.error(`Error sending PDF: ${err.message}`);
          return base.send_response("Failed to send welcome letter PDF", null, res, 500);
        }

        logger.info(`Welcome letter sent successfully for customer ID: ${customerId}`);
      });

    } catch (error) {
      logger.error(`Error retrieving welcome letter: ${error.message}`);
      return base.send_response("Failed to retrieve welcome letter: " + error.message, null, res, 500);
    }
  }
}

module.exports = new WelcomeLetterController();